I think the wrapper is the missing piece (and would delay loading even more in some cases), you should get your desired result using:

> factories(..., false).map(f->f.getAdapter(...)).findFirst().orElse(null);

if you want the first loaded one

> factories(..., false).filter(f->f.getAdapterList().length > 0).map(f->f.getAdapter(...)).findFirst().orElse(null);

if one wants the first non-null value of a loaded factory

> factories(..., false).map(f->f.getAdapter(...)).filter(Object::nonNull).findFirst().orElse(null);

... and so on ...

